import Layout from "../components/Layout";
import cephalopods from "../image/welcome.png";
import bts from "../image/BTS.png";
import candace from "../image/candace.png";
import purple from "../image/purple.png";
import jojo from "../image/jojo.png";
import egypte from "../image/egypte.png";
import scream from "../image/scream.png";
import Pinterest from "../image/Pinterest.png";
import dea from "../image/DEA.png";

function MyPngs() {
    return (
        <div className="MyPngs">
            <Layout>
                <h1 className="text-6xl text-center text-6xl hover:transition ease-in-out delay-150 hover:-translate-y-1 hover:scale-110 duration-300">Images</h1>

                <div className="flex flex-wrap">
                    <img className="h-56 pl-16 transition ease-in-out delay-150 hover:-translate-y-1 hover:scale-110 duration-300" src={cephalopods} alt="cephalopods"/>
                    <img className="h-56 transition ease-in-out delay-150 hover:-translate-y-1 hover:scale-110 duration-300" src={candace} alt="candace"/>
                    <img className="h-56 transition ease-in-out delay-150 hover:-translate-y-1 hover:scale-110 duration-300" src={jojo} alt="jojo"/>
                    <img className="h-56 transition ease-in-out delay-150 hover:-translate-y-1 hover:scale-110 duration-300" src={bts} alt="bts"/>
                    <img className="h-56 transition ease-in-out delay-150 hover:-translate-y-1 hover:scale-110 duration-300" src={purple} alt="purple"/>
                    <img className="h-56 transition ease-in-out delay-150 hover:-translate-y-1 hover:scale-110 duration-300" src={purple} alt="purple"/>
                    <img className="h-56 transition ease-in-out delay-150 hover:-translate-y-1 hover:scale-110 duration-300" src={purple} alt="purple"/>
                    <img className="h-56 transition ease-in-out delay-150 hover:-translate-y-1 hover:scale-110 duration-300" src={purple} alt="purple"/>
                    <img className="h-56 transition ease-in-out delay-150 hover:-translate-y-1 hover:scale-110 duration-300" src={purple} alt="purple"/>
                </div>
            </Layout>
        </div>
    );
}

export default MyPngs;
